import { BarChart,Bar,Rectangle,XAxis,YAxis,CartesianGrid,Tooltip,Legend } from "recharts";

function Bars (input) {
    let data = input.map((e) => ({day:e.day,kilogram:e.kilogram,calories:e.calories}))

    return (
        <BarChart width={500}
        height={300}
        data={data}
        margin={{
        top: 5,
        right: 30,
        left: 20,
        bottom: 5,
        }}>
            <CartesianGrid strokeDasharray="3 3"/>
            <XAxis dataKey="day"/>
            <YAxis/>
            <Tooltip />
            <Legend />
            <Bar dataKey="kilogram" fill="#8884d8" activeBar={<Rectangle fill="pink" stroke="blue" />} />
            <Bar dataKey="calories" fill="#82ca9d" activeBar={<Rectangle fill="gold" stroke="purple" />} />
        </BarChart>
    )
}

export default Bars
